function get(){let e;try{if("string"==typeof vc.window.activeTextEditor.document.languageId){e=vc.window.activeTextEditor.document.languageId;let t=Object.keys(conv.data).filter(t=>t.includes(e));return null!=conv.data[t[0]]&&(e=conv.data[t[0]]),e}}catch(e){"TypeError: Cannot read properties of undefined (reading 'document')"!=e&&console.warn("CLV > language.js = "+e)}return!1}const vc=require("vscode"),conv=require("./-converts.min.js");module.exports={get:get};